hnology have enabled a mogul to create an island full of living dinosaurs. John Hammond has invited four individuals, along with his two grandchildren, to join him. But will everything go to plan? Especially when one of the parks\' own workers attempts to steal the dinosaur embryos, and has to shut down critical security systems in the process. It\'s now a race for survival with dangerous creatures roaming all over the island.','John Doe'),(57,'ger1','Testing Project Ger1','Insert generic description of project that is made for testing purposes only.','John Doe'),(58,'NSGSample','NSG Sample Project','Project for every user to learn to use the Gateway. Contains sample data for each application.','John Doe'),(59,'DELTA','DELTA-Neuroimaging','MDD-R vs. control comparison, with repeated measures in patients.','Aart Schene'),(60,'AgeIV','AgeIV','','Charles Majoie'),(61,'mwcaan','Matthan Caan\'s scans (mwcaan)','','A.J. Nederveen'),(62,'test','test','project for test purposes solely','John Doe');
